    /*
     * Method: evalCubicCoeff
     *
     * Parameters:
     * a - {number} 值。
     * b - {number} 值。
     * c - {number} 值。
     * d - {number} 值。
     * t - {number} 值。
     *
     * Returns:
     * {number}
     */

